import Logo from './components/Logo'
import Menu from './components/Menu'
import Theme from './'

const Header = ({className, data}) => {
  const {
    name, 
    navigation: {
      menus: menuItems
    }
  } = data

  return (
    <header 
      data-name={name}
      className={className} 
    >
      <div className={`${className}__wrapper`}>
        <nav className={`${className}__nav`}>
          <Logo className={className}/>
          <Menu className={className} menuItems={menuItems}/>
        </nav>
        <Theme/>        
        {/* <Burger/> */}
      </div>
    </header>
  )
}

export default Header
